INSERT INTO estimacion (notas, owner, proyecto_id, sprint_id, tarea_id) VALUES ('Misma HU introducida varias veces con el mismo prompt, en un primer momento identifica cada caso de prueba como una historia de usuario, lo que no es del todo correcto ya que esas pruebas forman parte de la misma historia de usuario, si volvemos a introducir el prompt si nos devuelve una unica historia de usuario, con su correspondientes criterios de aceptacion, DoR y DoD
INSERT INTO estimacion (notas, owner, proyecto_id, sprint_id, tarea_id) VALUES ('Se ha utilizado para consultar y aclarar los endpoint y para que nos indicara como preparar los juegos de datos, en este caso nos ha indicado un comando de windows para generar ficheros de distinto tamaño.Tambien se ha utilizado para ayudarnos a interpretar los logs y que nos pusiera ejemplos ', 'Andrea Fernández', 15, 118, 745);
INSERT INTO estimacion (notas, owner, proyecto_id, sprint_id, tarea_id) VALUES ('Se ha utilizado la IA para extraer la cobetura de pruebas, ha requerido revisión y modificación posterior', 'Andrea Fernández', 15, 119, 741);
INSERT INTO estimacion (notas, owner, proyecto_id, sprint_id, tarea_id) VALUES ('Se le indica metodología utilizada, herramienta de seguimiento de pruebas y defectos, y se indica el área y aplicación utilizada. Se incluye una tabla con datos de 6 meses de una aplicación con los datos de distribución de los defectos por serveridad, grado de éxito de ejecución y cobertura alcanzada. Resultado: Define algunos KPI de forma correcta y otros no. Las recomendaciones que da para mejorar los KPI que no cumple con los objetivos, son lógicas. Creo que es un prompt complicado y hay que continuar refido un poco más,  y realizar más pruebas. No aporta una info con un valor añadido importante que ayude de momento, seguiré haciendo diferentes combinaciones para ir depurándolo.
INSERT INTO estimacion (notas, owner, proyecto_id, sprint_id, tarea_id) VALUES ('Se ha lanzado varias veces con los mismos datos (copiados y pegados de un documento de texto) y en cada caso devuelve una combinatoria de pruebas distinta, no sólo con distinto número de casos sino incluso con diferentes enfoques.
INSERT INTO estimacion (notas, owner, proyecto_id, sprint_id, tarea_id) VALUES ('No es fiable al 100% hay que hacer un analisis funcional de la HU, modifiicar, añadir y eliminar test de la cobetura generada', 'Fran García', 11, 120, 516);
