INSERT INTO estimacion (notas, owner, proyecto_id, sprint_id, tarea_id) VALUES ('Se ha utilizado sin prompt para, de una tabla de combinaciones de datos en la que relaciona variables cabecera y pie por aplicación y servicio con la aplicación y el servicio para el que se definirán, se ha intentado obtener por un lado el número de aplicaciones y servicio diferentes son necesarias para poder crear los datos de prueba sin interferencias entre las pruebas (no se consiguió) y por otro lado que simplemente estableciese un servicio-aplicación a aquellas variables que fueran diferentes (tampoco se consiguió así)', 'Cristian rodriguez', 25, 129, 1176);
INSERT INTO estimacion (notas, owner, proyecto_id, sprint_id, tarea_id) VALUES ('Obtención de cobertura de pruebas de la HU, se ha tenido que hacer alguna modificación en algun caso de prueba y eliminar un par que no aplicaban ', 'Andrea Fernández ', 15, 130, 1177);
INSERT INTO estimacion (notas, owner, proyecto_id, sprint_id, tarea_id) VALUES ('Generación de la cobertura funcional de pruebas para dos historias de usuario del buscador del portal de sentencias. Identifica los casos de prueba principales, con casuísticas de combinación de mayúsculas, minúsculas y palabras exactas.
INSERT INTO estimacion (notas, owner, proyecto_id, sprint_id, tarea_id) VALUES ('Obtención de cobertura de pruebas de la HU y casos de test con sus pasos detallados, se han tenido que hacer bastantes modificaciones: las descripciones de las Hus no son extensas y la IA olvida pasos lógicos a crear en la generación de pasos de casos. Aunque la obtención de Cobertura de pruebas funciona mejor, genera casos generales globales que no proceden aunque se le hace hincapié en los sub servicios.', 'Miguel Ángel Martín Rodríguez', 33, 132, 1179);
INSERT INTO estimacion (notas, owner, proyecto_id, sprint_id, tarea_id) VALUES ('Migracion de JUNIT4 a JUNIT5 sobre todo las validaciones de assertTrue, se tiene que poner exactamente como se quieren las modificaciones y un ejemplo de ello, ya que si no le das el ejemplo puede hacerlo de las formas que la IA considere mejor, hay veces que no realiza las modificaciones y te pasa el mismo codigo que le has dado.', 'Alberto Martos Garrido', 33, 133, 1180);
INSERT INTO estimacion (notas, owner, proyecto_id, sprint_id, tarea_id) VALUES ('Refactorizacion del codigo de atuomatizacion de pruebas para que se mas legible con metodos, pasandole un test de prueba , la IA separa el codigo en distintos metodos con nombres claros que te dicen lo que hacen. Como se hace test a test, muchos metodos estan duplicados o similares los cuales hay que modificar para poder usarlos varias veces.', 'Alberto Martos Garrido', 33, 134, 1181);
INSERT INTO estimacion (notas, owner, proyecto_id, sprint_id, tarea_id) VALUES ('Se trata de probar unos cambios en la cabecera de distintas pantallas de la misma aplicacion(alta, modificacion, borrado), ya que antes siempre tenia la misma. La IA devuelve los casos de prueba, estrategias y regresion correctos, aunque en el prompt de automatizacion añade pasos innecesarios ya que no sabe exactamente el codigo que tenemos, hay que ser extra explicitos con lo que se necesita.', 'Alberto Martos Garrido', 33, 134, 1182);
INSERT INTO estimacion (notas, owner, proyecto_id, sprint_id, tarea_id) VALUES ('Obtención de la cobertura de H.U realizando modificaciones, añadiendo casos que faltaban y elimido casos que no eran necasarios', 'Jose Vidarte Pulido', 31, 134, 1183);
