INSERT INTO estimacion (notas, owner, proyecto_id, sprint_id, tarea_id) VALUES ('Generación Excel de cobertura de pruebas utilizando la IA', 'Catalina Cangas', 27, 136, 1186);
INSERT INTO estimacion (notas, owner, proyecto_id, sprint_id, tarea_id) VALUES ('Obtención de cobertura de pruebas de la HU de bug asociada a DEF ALM  (se han reusado los casos),se han tenido que hacer bastantes modificaciones: genera casos generales globales que no proceden aunque se le hace hincapié en los sub servicios. El mayor problema Gen-Assitante se eterniza el adjuntar PDF (Chaptka interminable)', 'Miguel Ángel Martín Rodríguez', 33, 136, 1187);
INSERT INTO estimacion (notas, owner, proyecto_id, sprint_id, tarea_id) VALUES ('No teniendo acceso a los prompts especializados de GISS Testing de Automatización, se ha utilizado el GenAssistant con prompts personalizados para tareas sencillas y repetitivas como refactorizar codigo o agregar documentacion. Las respuestas de la IA no eran exactamente lo que se quería, y no se han utilizado más que de forma orientativa', 'Alberto Jesús Florido Fernández de Córdoba', 34, 136, 1188);
INSERT INTO estimacion (notas, owner, proyecto_id, sprint_id, tarea_id) VALUES ('No teniendo acceso a los prompts especializados de GISS Testing de Automatización, se ha utilizado el GenAssistant con prompts personalizados. En este caso, la tarea consistía en actualizar las pruebas automatizadas realizadas hace meses, para incorporar cambios en el desarrollo de la aplicación. Mi flujo de trabajo ha consistido en lanzar las pruebas una a una, analizar por qué ha fallado en el LOG, y corregir la prueba hasta que funcione correctamente. Es una tarea inevitablemente delicada y la IA no me ha podido ayudar, por ejemplo, a entender mejor el código del compañero.', 'Alberto Jesús Florido Fernández de Córdoba', 31, 137, 1189);
INSERT INTO estimacion (notas, owner, proyecto_id, sprint_id, tarea_id) VALUES ('Generación Excel de cobertura de pruebas utilizando la IA y pruebas de regresión. La IA de cobertura de pruebas saca casos de funcionalidad correctos, pero no lo hace con los casos específicos de validación de campos y botones, tampoco los caos de visualización, al tener que comprobar la maqueta no incluida en la HU, ni los casos de Back ya que los servicios a probar tampoco están definidos en la HU. Los casos de regresión si se ajusta más a la cobertura realizada sin IA, ya que aplican a los casos de funcionalidad.', 'Daniel Alcón Camarero', 26, 137, 1190);
INSERT INTO estimacion (notas, owner, proyecto_id, sprint_id, tarea_id) VALUES ('Prueba con el uso del prompt de diseño de casos de prueba para una prueba simple de configuración y  visualización de atributos, en base a la información que aporté el resultado fue el esperado.', 'Elizabeth Simoes', 35, 138, 1191);
INSERT INTO estimacion (notas, owner, proyecto_id, sprint_id, tarea_id) VALUES ('Generación Excel de cobertura de pruebas, generó una cobertura muy básica que fue necesario complementar', 'Elizabeth Simoes', 35, 139, 1192);
INSERT INTO estimacion (notas, owner, proyecto_id, sprint_id, tarea_id) VALUES ('Generación de comentarios para el codigo que ya estaba automatizado, ha sido capaz de reconocer el codigo y crear un comentario bastante acertado sobre lo que hace dicho script.', 'Manuel Arqués Yus', 36, 140, 1193);
INSERT INTO estimacion (notas, owner, proyecto_id, sprint_id, tarea_id) VALUES ('Cobertura muy básica, tuve que complementar. y más allá de darme de darme un conjunto de casos, los iba generano 1 por 1 y con steps lo cual no es relevante en la cobertura', 'Daniel Lares', 34, 141, 1194);
INSERT INTO estimacion (notas, owner, proyecto_id, sprint_id, tarea_id) VALUES ('Le he pegado un HTML entero para que me sacase los XPATH de unos elementos los cuales tendía que validar su correcta escritura', 'Vicent Miñana Gracia', 36, 142, 1195);
INSERT INTO estimacion (notas, owner, proyecto_id, sprint_id, tarea_id) VALUES ('Copie del alm unos steps que formulaban crear una query de sql con el resultado esperado, tras pequeños cambios, se lo formule a la IA para que me creara una linea de SQL con todas las condiciones y resultados esperados, han funcionado las pruebas', 'Hugo Barreira Rodriguez', 27, 142, 1196);
INSERT INTO estimacion (notas, owner, proyecto_id, sprint_id, tarea_id) VALUES ('Capaz de a traves de las indicaciones dadas para realizar unos casos, supo detallarme paso a paso las keywords que debia implementar explicando el funcionamiento de estas.', 'Ignacio Tuñas Tabares', 37, 142, 1197);
INSERT INTO estimacion (notas, owner, proyecto_id, sprint_id, tarea_id) VALUES ('Le pasé a la IA un código html y le pedí que me hiciera un script donde recorriera un paginador comprobando que accede a todas las páginas, el script era muy mejorable pero nada mal teniendo en cuenta que el html que le pasé no era muy completo', 'Antonio Luis Molina García', 32, 143, 1198);
INSERT INTO estimacion (notas, owner, proyecto_id, sprint_id, tarea_id) VALUES ('A partir de una HU con muy poco detalle se obtuvo con ayuda de la IA un conjunto de pruebas de cobertura completo. Fue necesaria bastante conversación para obtener el resultado en el formato deseado. El diseño se hizo a partir del excel de cobertura diseñado y también fue necesaria conversación para obtener los resultados. Además se invirtió tiempo que adaptar la planilla del excel de cobertura para que soportase los datos de diseño y poder hacer el exportado a ALM.', 'Begoña Prieto Pérez', 32, 143, 1199);
INSERT INTO estimacion (notas, owner, proyecto_id, sprint_id, tarea_id) VALUES ('A partir de una serie de Hus bien detalladas, se obtuvo un excel de cobertura muy afinado. El diseño se obtuvo a partir de la cobertura definida. En ambos casos fue necesaria conversación con la IA. Y se continuó trabajando en los mapeos y el excel de diseño.', 'Begoña Prieto Pérez', 32, 144, 1200);
INSERT INTO estimacion (notas, owner, proyecto_id, sprint_id, tarea_id) VALUES ('Obtención de cobertura de pruebas de la HU y casos de pruebas, se han tenido que hacer bastantes modificaciones y añadir casos: genera casos generales globales que no proceden, no obtiene del detalle casos a pesar de haber palabras token: "Escenario de pruebas" ó "Criterios de aceptación" con la información en párrafos: debería entender que hay una/unas casuística por párrafo con ese pie. El mayor problema Gen-Assitante se eterniza el adjuntar PDF (Chaptka interminable)', 'Miguel Ángel Martín Rodríguez', 33, 144, 1201);
INSERT INTO estimacion (notas, owner, proyecto_id, sprint_id, tarea_id) VALUES ('Obtención de cobertura de pruebas de la HU, se ha tenido que añadir los casos de prueba correspodientes a a quellos datos de prueba configurados por defecto.', 'Andrea Fernández ', 15, 144, 1202);
INSERT INTO estimacion (notas, owner, proyecto_id, sprint_id, tarea_id) VALUES ('Obtención de cobertura de pruebas de la HU y casos de test con sus pasos detallados, se han tenido que hacer bastantes modificaciones (casos duplicados): las descripciones de las Hus no son extensas y la IA olvida pasos lógicos a crear en la generación de pasos de casos. Aunque la obtención de Cobertura de pruebas funciona mejor, genera casos generales globales que no proceden aunque se le hace hincapié en los sub servicios.', 'Miguel Ángel Martín Rodríguez', 33, 145, 1203);
INSERT INTO estimacion (notas, owner, proyecto_id, sprint_id, tarea_id) VALUES ('Obtención de cobertura de pruebas de la HU y casos de test con sus pasos detallados, se han tenido que hacer bastantes modificaciones: las descripciones de las Hus no son extensas y la IA olvida pasos lógicos a crear en la generación de pasos de casos. Aunque la obtención de Cobertura de pruebas funciona mejor, genera casos generales globales a veces inecesarios como 2 casos de detalle para ver 2 secciones en la misma pantalla debería hacer hincapié en la palabra Criterios de aceptación (imponérselo a la IA como token) para que desarrollara al menos 1 caso por cada Criterio de acpetación, algunos los obvia (y si nos fiamos a ojos ciegos podríamos dar falsos positivos: no cubrimos toda la casuística).', 'Miguel Ángel Martín Rodríguez', 33, 145, 1204);
